import pygame
import sys

pygame.init()
screen = pygame.display.set_mode((400, 400))

def on_key_press(event):
    if event.key == pygame.K_ESCAPE:
        pygame.quit()
        sys.exit()

def on_key_release(event):
    if event.key == pygame.K_ESCAPE:
        pygame.quit()
        sys.exit()

pygame.display.flip()

while True:
    for event in pygame.event.get():
        if event.type == pygame.QUIT:
            break

        if event.type == pygame.KEYDOWN:
            if event.key == pygame.K_ESCAPE:
                pygame.quit()
                sys.exit()

        if event.type == pygame.KEYUP:
            if event.key == pygame.K_ESCAPE:
                pygame.quit()
                sys.exit()

        if event.type == pygame.MOUSEBUTTONDOWN:
            if event.button == 1:
                on_key_press(event)
            elif event.button == 2:
                on_key_release(event)

        if event.type == pygame.MOUSEBUTTONUP:
            if event.button == 1:
                on_key_release(event)

        if event.type == pygame.MOUSEMOTION:
            if event.pos == (400, 400):
                screen.fill((255, 0, 0))
                screen.blit(pygame.transform.scale(pygame.math.sin(time.time() * 10), (50, 50)), (400, 400))
            elif event.pos == (0, 0):
                screen.fill((255, 0, 0))
                screen.blit(pygame.transform.scale(pygame.math.sin(time.time() * 10), (50, 50)), (0, 0))
            elif event.pos == (400, 0):
                screen.fill((255, 0, 0))
                screen.blit(pygame.transform.scale(pygame.math.sin(time.time() * 10), (50, 50)), (400, 0))
            elif event.pos == (0, 400):
