            elif event.pos == (400, 400):
                screen.fill((255, 0, 0))
                screen.blit(pygame.transform.scale(pygame.math.sin(time.time() * 10), (50, 50)), (400, 400))
        time.sleep(0.01)

pygame.quit()
sys.exit()

